generated.css:
.gg-button {
    background-color: transparent;
    border-width: 2px;
    border-style: solid;
    font-size: 15px;
    color: white;
    width: auto;
    height: auto;
    display: flex;
    justify-content: center;
    align-items: center;
    text-transform: uppercase;
    cursor: pointer;
    padding: 3px;
}

.gg-button--round {
    border-radius: 50%;
    background-color: rgba(255, 255, 255, 1);
    font-size: 24px;
    color: rgb(140, 114, 242);
    width: 100%;
    height: 100%;
}
